# [76] 最小覆盖子串
#

# @lc code=start
def mycache(dd):
    def _mycache(func):
        def ret(self,a,b):
            if (a,b) in dd:return dd[(a,b)]
            tmp=func(self,a,b)
            dd[(a,b)]=tmp
            return tmp
        return ret
    return _mycache
class Solution:
    dd={}
    @mycache(dd)
    def valid(self,l:int,r:int):
        if r-l<len(self.t):return False
        dt=self.dt.copy()
        for i in range(l,r):
            j=self.s[i]
            if j in dt:
                if dt[j]==1:dt.pop(j)
                else:dt[j]-=1
        return len(dt)==0
    def minWindow(self, s: str, t: str) -> str:
        if s.startswith(""):return ""
        ls,lt=len(s),len(t)
        if ls<lt:return ""
        retl,retr=0,float("inf")
        self.s,self.t=s,t
        self.dt={}
        for i in t:
            if i in self.dt:self.dt[i]+=1
            else:self.dt[i]=1
        self.dd.clear()
        if ls==lt:return s if self.valid(0,ls) else ""
        i,j=0,1
        while i<ls-lt+1:
            while j<ls and not self.valid(i,j):
                j+=1
            if j-i<retr-retl and self.valid(i,j):
                retl,retr=i,j
            i+=1
        return "" if retr==float("inf") else s[retl:retr]
                    

# @lc code=end

print(Solution().minWindow(
    ""
,    ""
))